// src/pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Table } from "antd";

function Home() {
  
  const dataSource = [
    {
      key: '1',
      name: 'SSC - Staff Selection Commission',
      address: '10 Downing Street',
    },
    {
      key: '2',
      name: 'RRB - Indian Railway',
      address: '10 Downing Street',
    },
  ];
  
  const columns = [
    {
      title: 'DEPT',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'LINK',
      dataIndex: 'address',
      key: 'address',
    },
  ];
  

  return (
    <div className='home'>
        <h1>Indian Government Question and Answers</h1>
        <Table dataSource={dataSource} columns={columns} />;
      <ul>
        <li><Link to="/ssc">SSC</Link></li>
        <li><Link to="/rrb">RRB</Link></li>
        <li><Link to="/ibps">IBPS</Link></li>
        <li><Link to="/upsc-cms">UPSC CMS</Link></li>
        <li><Link to="/neet-pg">NEET PG</Link></li>
      </ul>
    </div>
  );
}

export default Home;
